    state = {  }
    render() {
        const { name, workout, category, score } = this.props.workout
        return (
            <>
                <div className="shade">
                    <div className="blackboard">
                        <div className="wod">
                        <h2 className="">{name}</h2>
                        <h3 className="">{category}</h3>
                        {workout.split('\n').map(element => {
                        return <h4 className="">{element}</h4>
                        })}
                        <h4 className="">{score}</h4>
                    </div>
                    </div>
                </div>
            </>
        );
    }
}

export default WOD;
